import axios from "axios";

export function getData(token, setToken, employees, setEmployees) {
  try {
       axios.post("http://cms.avertra.com/auth/local", {
      identifier: "Cms@avertra.com",
      password: "Avertra@2021",
    });
  }
  
  
  catch (error) {
    console.error(error);
  }
}
